import base64
import pickle
from collections import defaultdict
from typing import List, Tuple

MOD = int(1e9) + 7


class Matrix:
    def __init__(self, n: int, m: int):
        self.n = n
        self.m = m
        self.arr = [0] * (n * m)

    @classmethod
    def identity(cls, n: int) -> 'Matrix':
        mat = cls(n, n)
        for i in range(n):
            mat[i, i] = 1
        return mat

    def __getitem__(self, item: Tuple[int, int]) -> int:
        return self.arr[(item[0] * self.m) + item[1]]

    def __setitem__(self, key: Tuple[int, int], value: int) -> None:
        self.arr[(key[0] * self.m) + key[1]] = value

    def __mul__(self, other: 'Matrix') -> 'Matrix':
        assert self.m == other.n
        ret = Matrix(self.n, other.m)
        for i in range(self.n):
            for j in range(other.m):
                val = sum(self[i, k] * other[k, j] for k in range(self.m))
                if val >= MOD: val %= MOD
                ret[i, j] = val
        return ret

    @classmethod
    def load(cls, data: bytes) -> 'Matrix':
        n, m, arr = pickle.loads(base64.a85decode(data))
        mat = cls.__new__(cls)
        mat.n = n
        mat.m = m
        mat.arr = arr
        return mat

    def dump(self) -> bytes:
        return base64.a85encode(pickle.dumps((self.n, self.m, self.arr), protocol=pickle.HIGHEST_PROTOCOL))

    def __eq__(self, other: 'Matrix') -> bool:
        return self.n == other.n and self.m == other.m and self.arr == other.arr

    def __repr__(self) -> str:
        lines = [f"<Matrix {self.n} x {self.m}>"]
        for r in range(self.n):
            row = self.arr[(r * self.m):((r + 1) * self.m)]
            lines.append(repr(row))
        return "\n".join(lines)

    @property
    def sparsity(self) -> float:
        return sum(x != 0 for x in self.arr) / len(self.arr)


class CSCMatrix(Matrix):
    def __init__(self, mat: Matrix):
        self.n = mat.n
        self.m = mat.m
        self.cols: List[List[Tuple[int, int]]] = [[] for _ in range(self.m)]
        for i in range(self.n):
            for j in range(self.m):
                if mat[i, j] != 0:
                    self.cols[j].append((i, mat[i, j]))

    def __rmul__(self, other: Matrix) -> Matrix:
        assert other.m == self.n
        ret = Matrix(other.n, self.m)
        for i in range(other.n):
            for j in range(self.m):
                val = sum(v * other[i, k] for k, v in self.cols[j])
                if val >= MOD: val %= MOD
                ret[i, j] = val
        return ret


